二、算法题
题目
示例:
输入: 1->2->3->4->5->NULL
输出: 5->4->3->2->1->NULL
进阶:
你可以迭代或递归地反转链表。你能否用两种方法解决这道题？
解法一 （新建节点）
思路
* 使用一个变量记录前驱pre，一个变量记录后继next
* 保存当前节点的后置节点,再将之后递归到下一个节点
* 不断更新cur.next = pre 就好了
* 时间复杂度：O(N)O(N)
* 空间复杂度：O(1)O(1)
代码
var reverseList = function(head) {
    if (!head || !head.next) return head;

    let cur = head;
    let pre = null;

    while(cur) {
        const next = cur.next;
        cur.next = pre;
        pre = cur;
        cur = next;
    }

    return pre;
};

