var swapPairs = function(head) {
    let thead={
        val:null,
        next:head
    } //取巧，提前创建一个反向节点
    let current = thead
    while(current.next&&current.next.next){
        var a = current.next
        var b = a.next
        current.next = b //以下三步为交换指向
        a.next = b.next
        b.next = a
        current = current.next.next 向后跳两位
    }
    return thead.next
};

