每封电子邮件都由一个本地名称和一个域名组成，以 @ 符号分隔。
例如，在 alice@leetcode.com中， alice 是本地名称，而 leetcode.com 是域名。
除了小写字母，这些电子邮件还可能包含 '.' 或 '+'。
如果在电子邮件地址的本地名称部分中的某些字符之间添加句点（'.'），则发往那里的邮件将会转发到本地名称中没有点的同一地址。（请注意，此规则不适用于域名。）
例如：

alice.z@leetcode.com  === alicez@leetcode.com

如果在本地名称中添加加号（'+'），则会忽略第一个加号后面的所有内容。这允许过滤某些电子邮件 （同样，此规则不适用于域名。）
例如 ：

m.y+name@email.com
等于
my@email.com

给定电子邮件列表 emails，我们会向列表中的每个地址发送一封电子邮件。实际收到邮件的不同地址有多少？
输入：["test.email+alex@leetcode.com","test.e.mail+bob.cathy@leetcode.com","testemail+david@lee.tcode.com"]
输出：2
解释：实际收到邮件的是 "testemail@leetcode.com" 和 "testemail@lee.tcode.com"。
解法一（正则匹配）
思路

以@区分，拿到本地名称部分
删除 本地部分所有的.
删除+以及它之后的内容
拼接成结果地址
去重，并返回数组的长度

var numUniqueEmails = function(emails) {
    var obj = []
    emails.forEach((item,index) => {
        let em = item.split('@')
        em[0] = em[0].replace(/\./g,'')
        //实现相同需求的正则可以有很多个，下面的也可以写成 em[0] = em[0].replace(/(\w*)+(\+\w*)/g,'$1')
        em[0] = em[0].replace(/(\w*)+(\+.*)/,'$1')
        obj[index] = em[0]+'@'+em[1]
    });
    var arr = new Set(obj)
    return arr.size
};


解法二（indexOf）
和上解法一样的思路，只不过利用indexOf这个Api完成截取
var numUniqueEmails = function(emails) {
    var obj = []
    emails.forEach((item,index) => {
        let em = item.split('@')
        em[0] = em[0].replace(/\./g,'')
        var idx = em[0].indexOf('+')
        if(idx != -1){
            em[0] = em[0].slice(0, idx)
        }
        obj[index] = em[0]+'@'+em[1]
    });
    var arr = new Set(obj)
    return arr.size
};


