抽取题干提供的信息，2N个元素的数组，有一个元素出现了N次（数组的一版）
将数组排序
数组的前半部分 mid = (arr.length/2) -1
arr[mid] !== arr[mid-1] //如果与前一位不等，那么一定与后一位相等


var repeatedNTimes = function(A) {
